//  
// 0~9
function createDotmatrixNumberMenu() {
    let menu = [];
    for(let i = 0; i <= 9; i++) {
        menu.push({
            text: String(i),
            value: i
        });
    }
    return menu;
}

// a~z
function createDotmatrixSmallLetterMenu() {
    let menu = [];
    for(let i = 97; i <= 122; i++) {
        let char = String.fromCharCode(i);
        menu.push({
            text: char,
            value: char
        });
    }
    return menu;
}

// A~Z
function createDotmatrixCapitalLetterMenu() {
    let menu = [];
    for(let i = 65; i <= 90; i++) {
        let char = String.fromCharCode(i);
        menu.push({
            text: char,
            value: char
        });
    }
    return menu;
}

// ~
function createDotmatrixKoreanLetterMenu() {
    let menu = [];
    const koreanLetters = ['', '', '', '', '', '', '', '', '',
        '','','','',''];

    for(let i = 0; i < koreanLetters.length; i++) {
        let char = koreanLetters[i];
        menu.push({
            text: char,
            value: char
        });
    }
    return menu;
}

